column13:
An atomization device, comprising: 
• a first roller (720) having a plurality of grooves (724) disposed across a first surface (722) of the first roller, each of the plurality of grooves (724) enclosed by a pair of fins (726) that extend away from the first surface (722); 
• a second roller (710) configured to counter-rotate with respect to the first roller (720), the second roller (710) having a plurality of channels (714) disposed across a second surface (712); 
• the first (720) and second (710) rollers aligned with each other such that the plurality of grooves (724) of the first roller mate with the plurality of channels (714) of the second roller to form a plurality of enclosures; 
• a fluid source (800) configured to coat at least a surface of at least one of the rollers with a feed fluid; 
wherein a nip (706) is defined between each of the mated surfaces of the first (720) and second (710) rollers, and the feed fluid is drawn through each nip from an upstream side to a downstream side, such that the fluid is stretched on the downstream side of each nip as the first and second rollers counter-rotate.
